import ReactDOM from 'react-dom/client';
import App from './App';

import GlobalStyles from './global';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <GlobalStyles></GlobalStyles>
    <App />
  </React.StrictMode>
);
